import styled from 'styled-components';
import {Link} from 'react-router-dom';

const TagLink = styled(Link).attrs(props => ({
    to: props.url || "#"
}))`
    background: #a7ddf4;
    color: #206ce6;
    margin: 1rem;
    padding: .2rem;
`;

function TagCloud({url, children}) {
    return (<TagLink url={url}>{children}</TagLink>)
}

export default TagCloud;
